    Show(callback) {
        // show it
        $("#triggerwarn").addClass("show");
        // wait some time
        setTimeout(() => {
            // hide it & wait again
            $("#triggerwarn").removeClass("show");
            setTimeout(callback, this.animationSeconds * 1000);
        }, this.waitSeconds * 1000);
    }
